commits.content:
function getMostRecentDate(date1, date2) {
  console.log(Date.parse(date1));
  console.log(date2);
  return Date.parse(date1) > Date.parse(date2) ? date1 : date2;
}

console.log(getMostRecentDate("2022-05-01", "2022-04-30"));
// Output: "2022-05-01"
